import React from 'react'

const Secondimg = () => {
  return (
    <div className='headimg'>
        <img src="https://https://images.unsplash.com/photo-1625401586060-f12be3d7cc57?q=80&w=2940&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D.com/photos/green-grass-field-near-mountain-under-blue-sky-during-daytime-WvlFN57CyL8?utm_content=creditShareLink&utm_medium=referral&https://images.unsplash.com/photo-1625401586060-f12be3d7cc57?q=80&w=2940&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D=unsplash" alt="/" />
    </div>
  )
}

export default Secondimg;
